import React, { Component } from 'react';

class ButtonList extends Component {



    render() {
        return (
            <div>
                {this.props.characters.map((character, index) => {
                    <button type="button" key={index}>{character.name}</button>
                })}
            </div>
        );
    }
}

export default ButtonList;
